import React from 'react';
import styled from 'styled-components';

const EqualsLogo = "https://cdn.fairfx.com/images/group-email-signature/equals-dark.png"

const Background = styled.div`
  background-color: #343a40!important;
  position: relative;
  z-index: 1;
`;

const Wrapper = styled.div`
  height: 70px;
  max-width: 1140px;
  margin: 0 auto;
`;

const LogoWrapper = styled.div`  
  display: flex;
  height: 4rem;
  margin-right: auto;
`;

const Logo = styled.img`
  height: 42px;
  display: flex;
  align-items: center;
  align-self: center;
`;

const SlackInfo = styled.a`
  cursor: pointer;
  position: relative;
  color: red!important;
  padding: 0 0.75rem;
  transition: all 0.3s;
  text-decoration: none;
  margin-left; auto;

  :hover {
    color: red!important;
  }
`;

const HeaderNav = () => {
  return (
    <Background>
      <Wrapper>
        <LogoWrapper>
          <Logo src={EqualsLogo} />
          <SlackInfo>View our Terms â†’</SlackInfo>
        </LogoWrapper>
      </Wrapper>
    </Background>
  );
};

export default HeaderNav;
